INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('470', 'DE', 'Wir bitten um etwas Geduld und bemühen uns, die Seite wieder m\&ouml;glichst schnell  \r\nfunktionsbereit zu machen.', '2010-08-28 11:48:06');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('471', 'DE', 'Der Benutzer konnte nicht angelegt werden. Die Ursache ist unbekannt. Sollte dieser Fehler längere Zeit bestehen und du dich nicht registrieren können, schicke uns bitte eine <a href=\"mailto:%1\">E-Mail</a>.\r\n', '2010-08-28 11:48:06');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('472', 'DE', 'Wir achten auf dein Recht auf informationelle Selbstbestimmung. Deine persönlichen Daten werden in unserer Datenbank gespeichert, jedoch nicht an Dritte weitergegeben. Bitte beachte die genauen Ausführungen in unserer <a target=\"_blank\" href=\"articles.php?page=dsb\">Datenschutzerklärung</a>. Solltest du Fragen dazu haben, möchten wir dich bitten mit uns in Kontakt zu treten, <b>bevor</b> du dich registrierst.', '2010-08-28 11:48:06');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('473', 'DE', 'Dein Newseintrag kann leider erst nach einer Überprüfung angezeigt werden i.d.R. wird diese Überprüfung innerhalb von 24 bis \r\n						48 Stunden durchgeführt. Der Newseintrag kann nach der Bestätigung nicht mehr verändert werden. Sollten Änderungen notwendig \r\n						sein, bitte die korrigierte Nachricht einfach nochmals eingeben. Erlaubt sind Newseinträge zu allen Themen rund um\'s Geocaching.\r\n						Nicht erlaubt ist direkte Werbung für\r\n						Produkte oder einen Geocache. Die Freischaltung eines Newseintrags für die Anzeige auf der Webseite liegt ausschließlich im\r\n						Ermessen des Betreibers der Webseite - es besteht kein Anspruch auf eine Veröffentlichung. Im Zweifelsfall bitte den Newseintrag\r\n						melden und abwarten, ob er veröffentlicht wird, oder per E-Mail an <a href=\"mailto:%1\">%1</a>\r\n						vorher erkundigen.', '2010-08-28 11:48:06');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('474', 'DE', 'Sollte das Problem längere Zeit bestehen, wende dich bitte an <a href=\"mailto:%1\">%1</a>.', '2010-08-28 11:48:06');
