INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1541', 'DE', 'nur bei Nacht', '2010-09-12 22:54:51');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1542', 'DE', 'nur Hyperlink zu OC-externen Portalen', '2010-09-12 22:54:55');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1543', 'DE', 'Letterbox (benötigt Stempel)', '2010-09-12 22:55:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1544', 'DE', 'gefährliches Gebiet', '2010-09-12 22:55:05');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1545', 'DE', 'Der Geocache kann nur bei Nacht gel\&ouml;st werden und wird deshalb Nachtcache genannt. Zum Beispiel m\&uuml;ssen Reflektoren mit einer Taschenlampe angeleuchtet werden, die dann den Weg zum Versteck zeigen. Bitte ggf. auch das Attribut \&quot;Taschenlampe\&quot; setzen.', '2010-09-12 22:54:46');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1546', 'DE', 'Der Geocache ist nur bei Opencaching gelistet. Benutzer von anderen Geocache-Datenbanken haben so einen schnellen \&Uuml;berblick, welche Geocaches es sich lohnt n\&auml;her anzusehen.', '2010-09-12 22:54:41');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1548', 'DE', 'In dem Beh\&auml;lter vor Ort befindet sich ein Stempel, mit dem man sein pers\&ouml;nliches Logbuch abstempeln kann. Das Logbuch im Geocache wird ebenfalls mit einem pers\&ouml;nlichen Stempel signiert. Bitte achte unbedingt darauf, dass du den Stempel aus dem Geocache nicht mitnimmst oder tauschst! Die Aufgaben bei Letterboxen sind h\&auml;ufig so gestaltet, dass man den Geocache auch ohne GPS-Ger\&auml;t finden kann - wie bei einer klassichen Schnitzeljagd. Dann bitte auch das Attribut \&quot;ohne GPS\&quot; angeben.', '2010-09-12 22:55:27');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1549', 'DE', 'In dem Gebiet, wo der Geocache versteckt wurde, ist mit Gefahren zu rechnen. Mit diesem Attribut kann man auch auf Gefahren aufmerksam machen, die nicht auf den ersten Blick offensichtlich sind. Das k\&ouml;nnen z.B. stark befahrene Stra\&szlig;en, steile Abh\&auml;nge oder Steinschlag sein. Deshalb sollte man bei Geocaching-Touren mit Kindern oder gr\&ouml;\&szlig;eren Gruppen entsprechende Vorsichtsma\&szlig;nahmen ergreifen und je nachdem auch auf die Witterung achten (z.B. Regen bei steilen Abh\&auml;ngen). N\&auml;heres zu den Gefahren ist in der Cachebeschreibung erl\&auml;utert.', '2010-09-12 22:53:29');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1550', 'DE', 'aktive Eisenbahnlinie in der Nähe', '2010-09-12 23:13:51');
